import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import { publicRoutes } from '~/routes';

function App() {
    return (
        <Router>
            <div className="App">
                <Routes>
                    {publicRoutes.map((route, index) => {
                        const Layout = route.componentl;
                        <Route key={index} path={route.path} element={Layout} />;
                    })}
                </Routes>
            </div>
        </Router>
    );
}

export default App;
